script: |
  super -f text -I q11700.spq | sort > q11700.out

inputs:
  - name: q11700.spq
    data: |
      SELECT - + col2 FROM tab1 (FORMAT parquet) WHERE + col1 * + col0 NOT IN ( - 81 * + - ( - 20 ), ( - 38 ), - col1 );
  - name: tab1

outputs:
  - name: q11700.out
    data: |
      -59
      -68
      -96
